import { Gauge } from '@mui/x-charts/Gauge';

type AltProps = {
    alt: number,
}

const AltitudeGauge: React.FC<AltProps> = ({ alt }) => (
  <div className="w-64">
    <h2 className="text-lg font-semibold mb-2">Altitude</h2>
    <Gauge width={100} height={100} valueMin={5} valueMax={30} value={alt} />
  </div>
);

export default AltitudeGauge;
